import React from "react";
import "./App.css";
import JwtControler from "./Controlers/Jwt.controler";

function App() {
    var state = {
        jwtControler: new JwtControler(),
    };

    return (
        <div className="App">
            <button
                onClick={() => {
                    state.jwtControler.authenticate("admin", "admin");
                }}
            >
                It hurts
            </button>
        </div>
    );
}

export default App;
